('1','1','서비스 점검 안내','2025-05-03 02:00~04:00 시스템 정기 점검이 예정되어 있습니다. 서비스 이용에 참고 바랍니다.','IMPORTANT','2025-04-30 02:54:28',NULL,NULL),
('2','1','신규 기능 출시','차량 관제 알림 커스터마이징 기능이 v2.1으로 업데이트되었습니다.','NORMAL','2025-04-30 02:54:32',NULL,NULL),
('3','1','보안 패치 적용','시스템 보안 강화를 위해 긴급 패치가 적용되었습니다. 이용자 비밀번호 변경을 권장합니다.','IMPORTANT','2025-04-30 02:54:36',NULL,NULL),
('4','1','이용 정책 변경','서비스 이용 약관 및 개인정보 처리방침이 일부 개정되었습니다. 확인 및 동의 부탁드립니다.','NORMAL','2025-04-30 02:54:42',NULL,NULL),
('5','1','백업 작업 안내','2025-05-05 00:00~01:00 자동 백업 작업이 진행됩니다. 작업 중 일부 기능이 일시 중단될 수 있습니다.','NORMAL','2025-04-30 02:54:48',NULL,NULL),
('6','1','장애 복구 완료','2025-04-29 발생했던 실시간 데이터 수집 장애가 정상 복구되었습니다. 이용에 불편을 드려 죄송합니다.','IMPORTANT','2025-04-30 02:54:55',NULL,NULL),
('7','1','교육 일정 공지','관리자 대상 시스템 운영 교육이 2025-05-07 14:00에 온라인으로 진행됩니다. 참석 바랍니다.','NORMAL','2025-04-30 02:55:01',NULL,NULL);

